import React from 'react';

type TechStackProps = {
  t: {
    title: string;
  };
};

const logos = [
  {
    name: 'React',
    svg: (
      <svg viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg" className="h-10 w-10">
        <circle cx="20" cy="20" r="2.5" fill="#61DAFB" />
        <g stroke="#61DAFB" strokeWidth="2">
          <ellipse rx="17" ry="7" cx="20" cy="20" fill="none" />
          <ellipse rx="17" ry="7" cx="20" cy="20" fill="none" transform="rotate(60 20 20)" />
          <ellipse rx="17" ry="7" cx="20" cy="20" fill="none" transform="rotate(120 20 20)" />
        </g>
      </svg>
    ),
  },
  {
    name: 'Tailwind CSS',
    svg: (
      <svg viewBox="0 0 48 28" fill="none" xmlns="http://www.w3.org/2000/svg" className="h-8 w-12">
        <g>
          <path d="M13.5 0C7.5 0 4.5 3.5 4.5 10.5C4.5 17.5 7.5 21 13.5 21C16.5 21 18.5 19.5 19.5 16.5C20.5 19.5 22.5 21 25.5 21C31.5 21 34.5 17.5 34.5 10.5C34.5 3.5 31.5 0 25.5 0C22.5 0 20.5 1.5 19.5 4.5C18.5 1.5 16.5 0 13.5 0Z" fill="#38BDF8" />
          <path d="M34.5 7C40.5 7 43.5 10.5 43.5 17.5C43.5 24.5 40.5 28 34.5 28C31.5 28 29.5 26.5 28.5 23.5C27.5 26.5 25.5 28 22.5 28C16.5 28 13.5 24.5 13.5 17.5C13.5 10.5 16.5 7 22.5 7C25.5 7 27.5 8.5 28.5 11.5C29.5 8.5 31.5 7 34.5 7Z" fill="#38BDF8" />
        </g>
      </svg>
    ),
  },
  {
    name: 'OpenAI',
    img: (
      <img
        src="https://upload.wikimedia.org/wikipedia/commons/4/4b/OpenAI_Logo.svg"
        alt="OpenAI"
        className="h-10 w-10 object-contain"
        style={{ filter: 'invert(0)' }}
      />
    ),
  },
];

const TechStack: React.FC<TechStackProps> = ({ t }) => (
  <section className="w-full py-10 bg-white dark:bg-[#23272f] flex flex-col items-center transition-colors">
    <h2 className="text-xl font-semibold text-gray-700 dark:text-gray-200 mb-6">{t.title}</h2>
    <div className="flex flex-row gap-8 items-center justify-center">
      {logos.map((logo, idx) => (
        <div
          key={logo.name}
          className="bg-white dark:bg-[#23272f] border border-slate-200 dark:border-slate-700 rounded-lg p-2 flex items-center justify-center shadow-sm"
        >
          {logo.svg || logo.img}
        </div>
      ))}
    </div>
  </section>
);

export default TechStack;
